import { Box, Typography } from "@mui/material"






export const Feature = ({ title, text }) => {
    const StylesForSame = {
        color: '#FF8A71',
        textTransform: 'none'
    }
    
    return (
        <> 

      
                 <Typography
                 gutterBottom
                    sx={{...StylesForSame,width:'100%'}}
                    variant="h6"

                >
                    {title}
                </Typography>

             
                <Typography
                gutterBottom
                    sx={{...StylesForSame, width:'100%'}}

                    variant="body2"
                     
                >
                    {text}
                </Typography>
          
            
        </>
    )
}
